import React, { Component } from "react";
import "./team.css";
import Topbanner from "./topBanner";
import Navbar from "./navbar";
import Footer from "./footer";

class Team extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="container">
        <Topbanner />
        <Navbar />
        <div>
          <h4 className="heading">What is HSE Cert. International?</h4>
        </div>
        <Footer />
      </div>
    );
  }
}

export default Team;
